import './generalEducaton.css';
import React from 'react';
import { BrowserRouter as Router,Link } from 'react-router-dom';//BrowserRouter
import { Routes ,Route } from 'react-router-dom';
import back from './img/back.png';

const GeneralEducaton=()=>{
    function GeneralEducaton(){
        const [selectedField, setSelectedField] = useState('');
        const [responseData, setResponseData] = useState(null);

        const handleSubmit = (e) => {
        e.preventDefault();

        const formData = {
            field: selectedField
        };

        fetch('/general_education', {
            method: 'POST',
            headers: {
            'Content-Type': 'application/json'
            },
            body: JSON.stringify(formData)
        })
        .then(response => response.json())
        .then(data => {
            setResponseData(data);
            console.log(data);
        })
        .catch(error => {
            console.error(error);
        });
        }
        return(
            <div className='GeneralEducation'>
                <div className='g_education'>
                    <div>
                        <Link to='/Credit'>
                            <img src={back} alt="回上一頁" className="g_backicon"/>
                        </Link>
                    </div>
                    <div className="g_title">
                        <label className="titleText">通識領域</label>
                    </div>
                    <div className="selectDiv">
                        <select className="selectMust">
                            <option value="中外經典">人格</option>
                            <option value="">民主</option>
                            <option>自然</option>
                            <option>歷史</option>
                            <option value="全球化與社經結構">全球</option>
                            <option value="中外經典">經典</option>
                            <option>美學</option>
                            <option>科技</option>
                        </select>
                    </div>
                    <div className='g_Lable'>
                        <label></label>
                    </div>
                </div>
            </div>
            
        );
    }
    return (    
        <Routes>
            <Route path="/" element={<GeneralEducaton />}/>
        </Routes>
    
    );
}

export default GeneralEducaton;
